        /// <summary>
        /// 字串不同相連最長的長度
        /// </summary>
        /// <param name="s"></param>
        /// <returns></returns>
        public int LengthOfLongestSubstring(string s)
        {
            Dictionary<char, int> subset = new Dictionary<char, int>();
            int result = 0;
            int i = 0;
            int startIndex = 0;

            for (i = 0; i < s.Length; i++)
            {
                if (subset.ContainsKey(s[i]))
                {
                    if (i < s.Length - 1)
                    {
                        i = subset[s[i]];//下一輪會自動加一
                        startIndex = i + 1;
                        subset.Clear();
                    }
                }
                else
                {
                    subset.Add(s[i], i);
                    result = Math.Max(result, i - startIndex + 1);
                }
            }

            return result;
        }

        /// <summary>
        /// 參考別人的
        /// </summary>
        /// <param name="s"></param>
        /// <returns></returns>
        public int LengthOfLongestSubstring2(string s)
        {
            int length = s.Length, result = 0;
            int start = 0; // i

            Dictionary<char, int> subset = new Dictionary<char, int>();

            for (int j = 0; j < length; j++)
            {
                if (subset.ContainsKey(s[j]))
                {
                    if (subset[s[j]] >= start)
                        start = subset[s[j]];
                }

                result = Math.Max(result, j - start + 1);
                subset[s[j]] = j + 1;
            }
            return result;
        }
    }
